(19, 1, '1WlfLgbtG0NCGPDvojoroUEXNEQ40La5shy1rAgC.png', 'JROTfGXpU4UmEa2i03AeEp5R0uZtV8eN9M9pMpyf.png', '7IyequYxO0s6wyIdAt80J0pQhzByxkV7LYjBSGlW.png', '<h2><strong>It&rsquo;s time to change your ride experience!<br />\r\nDownload the Blue app Today</strong></h2>', 'i14BWjhLnQmRNSBixfIUq0dFlvNUxjC5WDZmbkp7.svg', 'cng3OM9Dptnrrjc2JOhy7Qsx2RYSU6L4FIVAtVSW.svg', 'tc0hC6m3wb9tUrZ0WTn3QVrR2ikIIekKHQvcTsV7.svg', '<h2><strong>Tap a button, get a ride</strong></h2>', '<p>Choose your ride and set your location. You&#39;ll see your driver&#39;s picture and vehicle details, and can track their arrival on the map.</p>', 'nMGcH7Cdd8HlaeBXqAbO9eCDiiX5lyKnsay6YxGf.svg', '<h2><strong>Always on, always available</strong></h2>\r\n\r\n<h2>&nbsp;</h2>', '<p>No phone calls to make, no pick-ups to schedule. With 24/7 availability, request a ride any time of day, any day of the year</p>', 'Q1KRguEcisJ1kzQ9QkvWo1Gbp29SUIqbKS8YHP2R.svg', '<h2><strong>You rate, we listen</strong></h2>', '<p>Rate your driver and provide anonymous feedback about your trip. Your input helps us make every ride a 5-star experience.</p>', 'Kkk2hUMTBfzzhJKSFoKqzgAy3VzLHKto684wie9x.jpg', '<h2><strong>On-demand rides for in-</strong></h2>\r\n\r\n<h2><strong>demand people</strong></h2>', '6ONOuxBnaUO7YHhKgL2W23SNpezkMCYWn3UCVuQc.jpg', '<h2><strong>Make your work commute</strong></h2>\r\n\r\n<h2><strong>or business trip more</strong></h2>\r\n\r\n<h2><strong>environmentally friendly</strong></h2>\r\n\r\n<h2><strong>and cost effective.</strong></h2>', 'C1SWBNAeHBWth8o1xcHkK33XxuOXUZdz2ACl547N.jpg', '<h2><strong>Safe and easy rides</strong></h2>\r\n\r\n<h2><strong>Througout North</strong></h2>\r\n\r\n<h2><strong>Carolina</strong></h2>', '<p>Blue is a rideshare platform facilitating peer to peer ridesharing by means of connecting passengers who are in need of rides from drivers with available cars to get from point A to point B with the press of a button.</p>', '<p>&copy; 2021 blue, LLC All rights reserved. <a href=\"http://localhost/taxiwebnew/index.php#\" target=\"blank\"> Powered By Blue </a></p>', '14Y4MHqKNFu3p835uAJCpTYy18k5RrZNbaUz9TQ9.png', 'footerinstalink', 'footerfblink', 'jIjFIDLtztvv6qaNXLo6NXP2NCQJra17K2xJQi3B.jpg', '<p>Due to the COVID-19 pandemic, tyt has updated health safety guidelines to help keep drivers and passengers safe. Under the new guidelines, drivers and passengers must stay home if they have COVID-19 or related symptoms, wear a face covering, keep the front seat empty, and roll windows down when possible. Drivers or passengers who repeatedly violate these new guidelines will be suspended. If a driver ever has a health safety concern, like someone not wearing a face covering, they can cancel the ride without incurring a fee.</p>', '<h2><strong>Our Service Locations</strong></h2>', '<p>We cover all major cities and surrounding areas in North Carolina. For every destination in life, we will connect you to a reliable driver in minutes. Let us take you there</p>', 'Fx14Mzje1kkGVzXnwC4H4XAnAnKQt8Ns0Lnya7DT.png,YI2xAmJ2WRpa89avWmoKJ3d5919c32oZia7aDnL5.png,8vYKhSvAcYQXiqFrEpUsqwJioFGad762yNZEYxgY.png,DGM0bkjr5HSFQnM7qalYTeGCFcE9J8hEf7LgfDbn.png,tT7PE5NqpaQSa2wrOZm8lq70xuvOkONJ1S2pBUqT.png', '<p>Privacy Policy<br />\r\nThe Scope of This Policy</p>\r\n\r\n<p>This policy applies to all Tagxi users, including Riders and Drivers (including Driver applicants), and to all Tagxi platforms and services, including our apps, websites, features, and other services (collectively, the &ldquo;Tagxi Platform&rdquo;). Please remember that your use of the Tagxi Platform is also subject to our Terms of Service.</p>\r\n\r\n<p>The Information We Collect</p>\r\n\r\n<p>When you use the Tagxi Platform, we collect the information you provide, usage information, and information about your device. We also collect information about you from other sources like third-party services, and optional programs in which you participate, which we may combine with other information we have about you. Here are the types of information we collect about you:</p>\r\n\r\n<p>A. Information You Provide to Us</p>\r\n\r\n<p>Account Registration. When you create an account with Tagxi, we collect the information you provide us, such as your name, email address, phone number, and payment information. You may choose to share additional info with us for your Rider profile, like your photo or saved addresses (e.g., home or work), and set up other preferences (such as your preferred pronouns).</p>\r\n\r\n<p>Driver Information. If you apply to be a Driver, we will collect the information you provide in your application, including your name, email address, phone number, birth date, profile photo, physical address, government identification number (such as social security number), driver&rsquo;s license information, vehicle information, and car insurance information. We collect the payment information you provide us, including your bank routing numbers, and tax information. Depending on where you want to drive, we may also ask for additional business license or permit information or other information to manage driving and programs relevant to that location. We may need additional information from you at some point after you become a Driver, including information to confirm your identity (like a photo).</p>\r\n\r\n<p>SOS Contact Information We will collect the contact list permission to list the contacts while adding the sos contacts for user &amp; driver app</p>\r\n\r\n<p>Ratings and Feedback. When you rate and provide feedback about Riders or Drivers, we collect all of the information you provide in your feedback.</p>\r\n\r\n<p>Communications. When you contact us or we contact you, we collect any information that you provide, including the contents of the messages or attachments you send us.</p>\r\n\r\n<p>B. Information We Collect When You Use the Tagxi Platform</p>\r\n\r\n<p>Location Information. Great rides start with an easy and accurate pickup. The Tagxi Platform collects location information (including GPS and WiFi data) differently depending on your Tagxi app settings and device permissions as well as whether you are using the platform as a Rider or Driver:</p>\r\n\r\n<p>Riders: We collect your device&rsquo;s precise location when you open and use the Tagxi app, including while the app is running in the background from the time you request a ride until it ends. Tagxi also tracks the precise location of scooters and e-bikes at all times.<br />\r\nDrivers: We collect your device&rsquo;s precise location when you open and use the app, including while the app is running in the background when it is in driver mode. We also collect precise location for a limited time after you exit driver mode in order to detect ride incidents, and continue collecting it until a reported or detected incident is no longer active.<br />\r\nUsage Information. We collect information about your use of the Tagxi Platform, including ride information like the date, time, destination, distance, route, payment, and whether you used a promotional or referral code. We also collect information about your interactions with the Tagxi Platform like our apps and websites, including the pages and content you view and the dates and times of your use.</p>\r\n\r\n<p>Device Information. We collect information about the devices you use to access the Tagxi Platform, including device model, IP address, type of browser, version of operating system, identity of carrier and manufacturer, radio type (such as 4G), preferences and settings (such as preferred language), application installations, device identifiers, advertising identifiers, and push notification tokens. If you are a Driver, we also collect mobile sensor data from your device (such as speed, direction, height, acceleration, deceleration, and other technical data).</p>\r\n\r\n<p>Communications Between Riders and Drivers. We work with a third party to facilitate phone calls and text messages between Riders and Drivers without sharing either party&rsquo;s actual phone number with the other. But while we use a third party to provide the communication service, we collect information about these communications, including the participants&rsquo; phone numbers, the date and time, and the contents of SMS messages. For security purposes, we may also monitor or record the contents of phone calls made through the Tagxi Platform, but we will always let you know we are about to do so before the call begins.</p>\r\n\r\n<p>Address Book Contacts. You may set your device permissions to grant Tagxi access to your contact lists and direct Tagxi to access your contact list, for example to help you refer friends to Tagxi. If you do this, we will access and store the names and contact information of the people in your address book.</p>\r\n\r\n<p>Cookies, Analytics, and Third-Party Technologies. We collect information through the use of &ldquo;cookies&rdquo;, tracking pixels, data analytics tools like Google Analytics, SDKs, and other third-party technologies to understand how you navigate through the Tagxi Platform and interact with Tagxi advertisements, to make your Tagxi experience safer, to learn what content is popular, to improve your site experience, to serve you better ads on other sites, and to save your preferences. Cookies are small text files that web servers place on your device; they are designed to store basic information and to help websites and apps recognize your browser. We may use both session cookies and persistent cookies. A session cookie disappears after you close your browser. A persistent cookie remains after you close your browser and may be accessed every time you use the Tagxi Platform. You should consult your web browser(s) to modify your cookie settings. Please note that if you delete or choose not to accept cookies from us, you may miss out on certain features of the Tagxi Platform.</p>\r\n\r\n<p>C. Information We Collect from Third Parties</p>\r\n\r\n<p>Third-Party Services. Third-party services provide us with information needed for core aspects of the Tagxi Platform, as well as for additional services, programs, loyalty benefits, and promotions that can enhance your Tagxi experience. These third-party services include background check providers, insurance partners, financial service providers, marketing providers, and other businesses. We obtain the following information about you from these third-party services:</p>\r\n\r\n<p>Information to make the Tagxi Platform safer, like background check information for drivers;<br />\r\nInformation about your participation in third-party programs that provide things like insurance coverage and financial instruments, such as insurance, payment, transaction, and fraud detection information;<br />\r\nInformation to operationalize loyalty and promotional programs or applications, services, or features you choose to connect or link to your Tagxi account, such as information about your use of such programs, applications, services, or features; and<br />\r\nInformation about you provided by specific services, such as demographic and market segment information.<br />\r\nEnterprise Programs. If you use Tagxi through your employer or other organization that participates in one of our Tagxi Business enterprise programs, we will collect information about you from those parties, such as your name and contact information.</p>\r\n\r\n<p>Concierge Service. Sometimes another business or entity may order you a Tagxi ride. If an organization has ordered a ride for you using our Concierge service, they will provide us your contact information and the pickup and drop-off location of your ride.</p>\r\n\r\n<p>Referral Programs. Friends help friends use the Tagxi Platform. If someone refers you to Tagxi, we will collect information about you from that referral including your name and contact information.</p>\r\n\r\n<p>Other Users and Sources. Other users or public or third-party sources such as law enforcement, insurers, media, or pedestrians may provide us information about you, for example as part of an investigation into an incident or to provide you support.</p>\r\n\r\n<p>How We Use Your Information</p>\r\n\r\n<p>We use your personal information to:</p>\r\n\r\n<p>Provide the Tagxi Platform;<br />\r\nMaintain the security and safety of the Tagxi Platform and its users;<br />\r\nBuild and maintain the Tagxi community;<br />\r\nProvide customer support;<br />\r\nImprove the Tagxi Platform; and<br />\r\nRespond to legal proceedings and obligations.<br />\r\nProviding the Tagxi Platform. We use your personal information to provide an intuitive, useful, efficient, and worthwhile experience on our platform. To do this, we use your personal information to:</p>\r\n\r\n<p>Verify your identity and maintain your account, settings, and preferences;<br />\r\nConnect you to your rides and track their progress;<br />\r\nCalculate prices and process payments;<br />\r\nAllow Riders and Drivers to connect regarding their ride and to choose to share their location with others;<br />\r\nCommunicate with you about your rides and experience;<br />\r\nCollect feedback regarding your experience;<br />\r\nFacilitate additional services and programs with third parties; and<br />\r\nOperate contests, sweepstakes, and other promotions.<br />\r\nMaintaining the Security and Safety of the Tagxi Platform and its Users. Providing you a secure and safe experience drives our platform, both on the road and on our apps. To do this, we use your personal information to:</p>\r\n\r\n<p>Authenticate users;<br />\r\nVerify that Drivers and their vehicles meet safety requirements;<br />\r\nInvestigate and resolve incidents, accidents, and insurance claims;<br />\r\nEncourage safe driving behavior and avoid unsafe activities;<br />\r\nFind and prevent fraud; and<br />\r\nBlock and remove unsafe or fraudulent users from the Tagxi Platform.<br />\r\nBuilding and Maintaining the Tagxi Community. Tagxi works to be a positive part of the community. We use your personal information to:</p>\r\n\r\n<p>Communicate with you about events, promotions, elections, and campaigns;<br />\r\nPersonalize and provide content, experiences, communications, and advertising to promote and grow the Tagxi Platform; and<br />\r\nHelp facilitate donations you choose to make through the Tagxi Platform.<br />\r\nProviding Customer Support. We work hard to provide the best experience possible, including supporting you when you need it. To do this, we use your personal information to:</p>\r\n\r\n<p>Investigate and assist you in resolving questions or issues you have regarding the Tagxi Platform; and<br />\r\nProvide you support or respond to you.<br />\r\nImproving the Tagxi Platform. We are always working to improve your experience and provide you with new and helpful features. To do this, we use your personal information to:</p>\r\n\r\n<p>Perform research, testing, and analysis;<br />\r\nDevelop new products, features, partnerships, and services;<br />\r\nPrevent, find, and resolve software or hardware bugs and issues; and<br />\r\nMonitor and improve our operations and processes, including security practices, algorithms, and other modeling.<br />\r\nResponding to Legal Proceedings and Requirements. Sometimes the law, government entities, or other regulatory bodies impose demands and obligations on us with respect to the services we seek to provide. In such a circumstance, we may use your personal information to respond to those demands or obligations.</p>\r\n\r\n<p>How We Share Your Information</p>\r\n\r\n<p>We do not sell your personal information. To make the Tagxi Platform work, we may need to share your personal information with other users, third parties, and service providers. This section explains when and why we share your information.</p>\r\n\r\n<p>A. Sharing Between Tagxi Users</p>\r\n\r\n<p>Riders and Drivers.</p>\r\n\r\n<p>Rider information shared with Driver: Upon receiving a ride request, we share with the Driver the Rider&rsquo;s pickup location, name, profile photo, rating, Rider statistics (like approximate number of rides and years as a Rider), and information the Rider includes in their Rider profile (like preferred pronouns). Upon pickup and during the ride, we share with the Driver the Rider&rsquo;s destination and any additional stops the Rider inputs into the Tagxi app. Once the ride is finished, we also eventually share the Rider&rsquo;s rating and feedback with the Driver. (We remove the Rider&rsquo;s identity associated with ratings and feedback when we share it with Drivers, but a Driver may be able to identify the Rider that provided the rating or feedback.)</p>\r\n\r\n<p>Driver information shared with Rider: Upon a Driver accepting a requested ride, we will share with the Rider the Driver&rsquo;s name, profile photo, preferred pronouns, rating, real-time location, and the vehicle make, model, color, and license plate, as well as other information in the Driver&rsquo;s Tagxi profile, such as information Drivers choose to add (like country flag and why you drive) and Driver statistics (like approximate number of rides and years as a Driver).</p>\r\n\r\n<p>Although we help Riders and Drivers communicate with one another to arrange a pickup, we do not share your actual phone number or other contact information with other users. If you report a lost or found item to us, we will seek to connect you with the relevant Rider or Driver, including sharing actual contact information with your consent.</p>\r\n\r\n<p>Shared Ride Riders. When Riders use a Tagxi Shared ride, we share each Rider&rsquo;s name and profile picture to ensure safety. Riders may also see each other&rsquo;s pickup and drop-off locations as part of knowing the route while sharing the ride.</p>\r\n\r\n<p>Rides Requested or Paid For by Others. Some rides you take may be requested or paid for by others. If you take one of those rides using your Tagxi Business Profile account, a code or coupon, a subsidized program (e.g., transit or government), or a corporate credit card linked to another account, or another user otherwise requests or pays for a ride for you, we may share some or all of your ride details with that other party, including the date, time, charge, rating given, region of trip, and pick up and drop off location of your ride.</p>\r\n\r\n<p>Referral Programs. If you refer someone to the Tagxi Platform, we will let them know that you generated the referral. If another user referred you, we may share information about your use of the Tagxi Platform with that user. For example, a referral source may receive a bonus when you join the Tagxi Platform or complete a certain number of rides and would receive such information.</p>\r\n\r\n<p>B. Sharing With Third-Party Service Providers for Business Purposes</p>\r\n\r\n<p>Depending on whether you&rsquo;re a Rider or a Driver, Tagxi may share the following categories of your personal information for a business purpose to provide you with a variety of the Tagxi Platform&rsquo;s features and services:</p>\r\n\r\n<p>Personal identifiers, such as your name, address, email address, phone number, date of birth, government identification number (such as social security number), driver&rsquo;s license information, vehicle information, and car insurance information;<br />\r\nFinancial information, such as bank routing numbers, tax information, and any other payment information you provide us;<br />\r\nCommercial information, such as ride information, Driver/Rider statistics and feedback, and Driver/Rider transaction history;<br />\r\nInternet or other electronic network activity information, such as your IP address, type of browser, version of operating system, carrier and/or manufacturer, device identifiers, and mobile advertising identifiers; and<br />\r\nLocation data.<br />\r\nWe disclose those categories of personal information to service providers to fulfill the following business purposes:</p>\r\n\r\n<p>Maintaining and servicing your Tagxi account;<br />\r\nProcessing or fulfilling rides;<br />\r\nProviding you customer service;<br />\r\nProcessing Rider transactions;<br />\r\nProcessing Driver applications and payments;<br />\r\nVerifying the identity of users;<br />\r\nDetecting and preventing fraud;<br />\r\nProcessing insurance claims;<br />\r\nProviding Driver loyalty and promotional programs;<br />\r\nProviding marketing and advertising services to Tagxi;<br />\r\nProviding financing;<br />\r\nProviding requested emergency services;<br />\r\nProviding analytics services to Tagxi; and<br />\r\nUndertaking internal research to develop the Tagxi Platform.<br />\r\nC. For Legal Reasons and to Protect the Tagxi Platform</p>\r\n\r\n<p>Comply with any applicable federal, state, or local law or regulation, civil, criminal or regulatory inquiry, investigation or legal process, or enforceable governmental request;<br />\r\nRespond to legal process (such as a search warrant, subpoena, summons, or court order);<br />\r\nEnforce our Terms of Service;<br />\r\nCooperate with law enforcement agencies concerning conduct or activity that we reasonably and in good faith believe may violate federal, state, or local law; or<br />\r\nExercise or defend legal claims, protect against harm to our rights, property, interests, or safety or the rights, property, interests, or safety of you, third parties, or the public as required or permitted by law.<br />\r\nD. In Connection with Sale or Merger</p>\r\n\r\n<p>We may share your personal information while negotiating or in relation to a change of corporate control such as a restructuring, merger, or sale of our assets.</p>\r\n\r\n<p>E. Upon Your Further Direction</p>\r\n\r\n<p>With your permission or upon your direction, we may disclose your personal information to interact with a third party or for other purposes.</p>\r\n\r\n<p>How We Store and Protect Your Information</p>\r\n\r\n<p>We retain your information for as long as necessary to provide you and our other users the Tagxi Platform. This means we keep your profile information for as long as you maintain an account. We retain transactional information such as rides and payments for at least seven years to ensure we can perform legitimate business functions, such as accounting for tax obligations. If you request account deletion, we will delete your information as set forth in the &ldquo;Deleting Your Account&rdquo; section below. We take reasonable and appropriate measures designed to protect your personal information. But no security measures can be 100% effective, and we cannot guarantee the security of your information, including against unauthorized intrusions or acts by third parties.</p>\r\n\r\n<p>Your Rights And Choices Regarding Your Data</p>\r\n\r\n<p>Tagxi provides ways for you to access and delete your personal information as well as exercise other data rights that give you certain control over your personal information.</p>\r\n\r\n<p>A. All Users</p>\r\n\r\n<p>Email Subscriptions. You can always unsubscribe from our commercial or promotional emails by clicking unsubscribe in those messages. We will still send you transactional and relational emails about your use of the Tagxi Platform.</p>\r\n\r\n<p>Text Messages. You can opt out of receiving commercial or promotional text. You may also opt out of receiving all texts from Tagxi (including transactional or relational messages. Note that opting out of receiving all texts may impact your use of the Tagxi Platform. Drivers can also opt out of driver-specific messages by texting STOP in response to a driver SMS. To re-enable texts you can text START in response to an unsubscribe confirmation SMS.</p>\r\n\r\n<p>Push Notifications. You can opt out of receiving push notifications through your device settings. Please note that opting out of receiving push notifications may impact your use of the Tagxi Platform (such as receiving a notification that your ride has arrived).</p>\r\n\r\n<p>Profile Information. You can review and edit certain account information you have chosen to add to your profile by logging in to your account settings and profile.</p>\r\n\r\n<p>Location Information. You can prevent your device from sharing location information through your device&rsquo;s system settings. But if you do, this may impact Tagxi&rsquo;s ability to provide you our full range of features and services.</p>\r\n\r\n<p>Cookie Tracking. You can modify your cookie settings on your browser, but if you delete or choose not to accept our cookies, you may be missing out on certain features of the Tagxi Platform.</p>\r\n\r\n<p>Do Not Track. Your browser may offer you a &ldquo;Do Not Track&rdquo; option, which allows you to signal to operators of websites and web applications and services that you do not want them to track your online activities. The Tagxi Platform does not currently support Do Not Track requests at this time.</p>\r\n\r\n<p>Deleting Your Account. If you would like to delete your Tagxi account, please visit our privacy homepage. In some cases, we will be unable to delete your account, such as if there is an issue with your account related to trust, safety, or fraud. When we delete your account, we may retain certain information for legitimate business purposes or to comply with legal or regulatory obligations. For example, we may retain your information to resolve open insurance claims, or we may be obligated to retain your information as part of an open legal claim. When we retain such data, we do so in ways designed to prevent its use for other purposes.</p>\r\n\r\n<p>Right to Know. You have the right to know and see what data we have collected about, including:</p>\r\n\r\n<p>The categories of personal information we have collected about you;<br />\r\nThe categories of sources from which the personal information is collected;<br />\r\nThe business or commercial purpose for collecting your personal information;<br />\r\nThe categories of third parties with whom we have shared your personal information; and<br />\r\nThe specific pieces of personal information we have collected about you.<br />\r\nRight to Delete. You have the right to request that we delete the personal information we have collected from you (and direct our service providers to do the same). There are a number of exceptions, however, that include, but are not limited to, when the information is necessary for us or a third party to do any of the following:</p>\r\n\r\n<p>Complete your transaction;<br />\r\nProvide you a good or service;<br />\r\nPerform a contract between us and you;<br />\r\nProtect your security and prosecute those responsible for breaching it;<br />\r\nFix our system in the case of a bug;<br />\r\nProtect the free speech rights of you or other users;<br />\r\nEngage in public or peer-reviewed scientific, historical, or statistical research in the public interests that adheres to all other applicable ethics and privacy laws;<br />\r\nComply with a legal obligation; or<br />\r\nMake other internal and lawful uses of the information that are compatible with the context in which you provided it.<br />\r\nOther Rights. You can request certain information about our disclosure of personal information to third parties for their own direct marketing purposes during the preceding calendar year. This request is free and may be made once a year. You also have the right not to be discriminated against for exercising any of the rights listed above.</p>\r\n\r\n<p>Website: You may visit our privacy homepage to authenticate and exercise rights via our website.</p>\r\n\r\n<p>Email webform: You may write to us to exercise rights. To respond to some rights we will need to verify your request either by asking you to log in and authenticate your account or otherwise verify your identity by providing information about yourself or your account. Authorized agents can make a request on your behalf if you have given them legal power of attorney or we are provided proof of signed permission, verification of your identity, and confirmation that you provided the agent permission to submit the request. Response Timing and Format. We aim to respond to a consumer request for access or deletion within 45 days of receiving that request. If we require more time, we will inform you of the reason and extension period in writing.</p>\r\n\r\n<p>Children&rsquo;s Data</p>\r\n\r\n<p>Tagxi is not directed to children, and we don&rsquo;t knowingly collect personal information from children under the age of 13. If we find out that a child under 13 has given us personal information, we will take steps to delete that information. If you believe that a child under the age of 13 has given us personal information, please contact us</p>\r\n\r\n<p>Links to Third-Party Websites</p>\r\n\r\n<p>The Tagxi Platform may contain links to third-party websites. Those websites may have privacy policies that differ from ours. We are not responsible for those websites, and we recommend that you review their policies. Please contact those websites directly if you have any questions about their privacy policies.</p>\r\n\r\n<p>Changes to This Privacy Policy</p>\r\n\r\n<p>We may update this policy from time to time as the Tagxi Platform changes and privacy law evolves. If we update it, we will do so online, and if we make material changes, we will let you know through the Tagxi Platform or by some other method of communication like email. When you use Tagxi, you are agreeing to the most recent terms of this policy.</p>\r\n\r\n<p>Contact Us</p>\r\n\r\n<p>If you have any questions or concerns about your privacy or anything in this policy, including if you need to access this policy in an alternative format, we encourage you to contact us.</p>', '<h2><strong>DMV check &amp; background check consent</strong></h2>\n\n<p>&nbsp;</p>\n\n<p>Consent to Request Driving Record</p>\n\n<p>I understand that tyt, LLC. (&lsquo;Company&rsquo;) will use Checkr., (&lsquo;Checkr, Inc.&rsquo;) to obtain a motor vehicle record as part of the application process to be a driver on the tyt Platform (a &lsquo;Driver&rsquo;). I also understand that if accepted as a Driver, to the extent permitted by law, Company may obtain further Reports from Checkr Inc. so as to update, renew or extend my status as a Driver. I hereby give permission to tyt to obtain my state driving record (also known as my motor vehicle record or MVR) in accordance with the Federal Driver&rsquo;s Privacy Protection Act (&lsquo;DPPA&rsquo;) and applicable state law. I acknowledge and understand that my driving record is a consumer report that contains public record information. I authorize, without reservation any party or agency contacted by Company or Checkr Inc. to furnish Company a copy of my state driving record. This authorization shall remain on file by Company for the duration of my time as a Driver, and will serve as ongoing authorization for Company to procure my state driving record at any time while I am a Driver.</p>\n\n<p>Consent to Request Consumer Report or Investigative Consumer Report Information</p>\n\n<p>I understand that tyt, LLC. (&lsquo;Company&rsquo;) will use Checkr Inc.,</p>\n\n<p>1 Montgomery St, Ste 2000, San Francisco, CA 94104</p>\n\n<p>to obtain a consumer report or investigative consumer report as part of the application process to be a driver on the tyt Platform (a &lsquo;Driver&rsquo;). I also understand that if accepted as a Driver, to the extent permitted by law, Company may obtain further Reports from Checkr so as to update, renew or extend my status as a Driver.</p>\n\n<p>I understand Checkr, Inc&rsquo;s (&ldquo;Checkr&rdquo;) investigation may include obtaining information regarding my criminal record, subject to any limitations imposed by applicable federal and state law. I understand such information may be obtained through direct or indirect contact with public agencies or other persons who may have such knowledge.</p>\n\n<p>The nature and scope of the investigation sought will include a Criminal Background check and SSN Trace.</p>\n\n<p>I acknowledge receipt of the attached summary of my rights under the Fair Credit Reporting Act and, as required by law, any related state summary of rights (collectively &ldquo;Summaries of Rights&rdquo;).</p>\n\n<p>This consent will not affect my ability to question or dispute the accuracy of any information contained in a Report. I understand if Company makes a conditional decision to disqualify me based all or in part on my Report, I will be provided with a copy of the Report and another copy of the Summaries of Rights, and if I disagree with the accuracy of the purported disqualifying information in the Report, I must notify Company within five business days of my receipt of the Report that I am challenging the accuracy of such information with Checkr.</p>\n\n<p>I hereby consent to this investigation and authorize Company to procure a Report on my background.</p>\n\n<p>In order to verify my identity for the purposes of Report preparation, I am voluntarily releasing my date of birth, social security number and the other information and fully understand that all decisions are based on legitimate non-discriminatory reasons.</p>\n\n<p>The name, address and telephone number of the nearest unit of the consumer reporting agency designated to handle inquiries regarding the investigative consumer report is:</p>\n\n<p><strong>Checkr, Inc.<br />\n1 Montgomery St, Ste 2000, San Francisco, CA 94104<br />\n844-824-3257 </strong><br />\n<br />\n<strong>California, Maine, Massachusetts, Minnesota, New Jersey &amp; Oklahoma Applicants Only:</strong> I have the right to request a copy of any Report obtained by Company from Checkr by checking the box. (Check only if you wish to receive a copy)</p>\n\n<p>New York Applicants Only</p>\n\n<p>I also acknowledge that I have received the attached copy of Article 23A of New York&rsquo;s Correction Law. I further understand that I may request a copy of any investigative consumer report by contacting Checkr. I further understand that I will be advised if any further checks are requested and provided the name and address of the consumer reporting agency.</p>\n\n<p>California Applicants and Residents</p>\n\n<p>If I am applying in California or reside in California, I understand I have the right to visually inspect the files concerning me maintained by an investigative consumer reporting agency during normal business hours and upon reasonable notice. The inspection can be done in person, and, if I appear in person and furnish proper identification; I am entitled to a copy of the file for a fee not to exceed the actual costs of duplication. I am entitled to be accompanied by one person of my choosing, who shall furnish reasonable identification. The inspection can also be done via certified mail if I make a written request, with proper identification, for copies to be sent to a specified addressee. I can also request a summary of the information to be provided by telephone if I make a written request, with proper identification for telephone disclosure, and the toll charge, if any, for the telephone call is prepaid by or directly charged to me. I further understand that the investigative consumer reporting agency shall provide trained personnel to explain to me any of the information furnished to me; I shall receive from the investigative consumer reporting agency a written explanation of any coded information contained in files maintained on me. &ldquo;Proper identification&rdquo; as used in this paragraph means information generally deemed sufficient to identify a person, including documents such as a valid driver&rsquo;s license, social security account number, military identification card and credit cards. I understand that I can access the following website checkr.com privacy to view Checkr&rsquo;s privacy practices, including information with respect to Checkr&rsquo;s preparation and processing of investigative consumer reports and guidance as to whether my personal information will be sent outside the United States or its territories.</p>\n\n<p>A Summary of Your Rights Under the Fair Credit Reporting Act</p>\n\n<p>The federal Fair Credit Reporting Act (FCRA) promotes the accuracy, fairness, and privacy of information in the files of consumer reporting agencies. There are many types of consumer reporting agencies, including credit bureaus and specialty agencies (such as agencies that sell information about check writing histories, medical records, and rental history records). Here is a summary of your major rights under the FCRA. <strong>For more information, including information about additional rights, go to www.consumerfinance.gov/learnmore or write to:</strong></p>\n\n<p>Consumer Financial Protection Bureau<br />\n1700 G Street NW, Washington, DC 20552</p>\n\n<p>&nbsp;</p>\n\n<ul>\n<li>You must be told if information in your file has been used against you. Anyone who uses a credit report or another type of consumer report to deny your application for credit, insurance, or employment &ndash; or to take another adverse action against you &ndash; must tell you, and must give you the name, address, and phone number of the agency that provided the information.</li>\n<li>You have the right to know what is in your file. You may request and obtain all the information about you in the files of a consumer reporting agency (your &ldquo;file disclosure&rdquo;). You will be required to provide proper identification, which may include your Social Security number. In many cases, the disclosure will be free. You are entitled to a free file disclosure if:\n<ol>\n<li>a person has taken adverse action against you because of information in your credit report;</li>\n<li>you are the victim of identity theft and place a fraud alert in your file;</li>\n<li>your file contains inaccurate information as a result of fraud;</li>\n<li>you are on public assistance;</li>\n<li>you are unemployed but expect to apply for employment within 60 days.</li>\n</ol>\nIn addition, all consumers are entitled to one free disclosure every 12 months upon request from each nationwide credit bureau and from nationwide specialty consumer reporting agencies. See www.consumerfinance.gov/learnmore for additional information.</li>\n<li>You have the right to ask for a credit score. Credit scores are numerical summaries of your credit-worthiness based on information from credit bureaus. You may request a credit score from consumer reporting agencies that create scores or distribute scores used in residential real property loans, but you will have to pay for it. In some mortgage transactions, you will receive credit score information for free from the mortgage lender.</li>\n<li>You have the right to dispute incomplete or inaccurate information. If you identify information in your file that is incomplete or inaccurate, and report it to the consumer reporting agency, the agency must investigate unless your dispute is frivolous. See www.consumerfinance.gov/learnmore for an explanation of dispute procedures.</li>\n<li>Consumer reporting agencies must correct or delete inaccurate, incomplete, or unverifiable information. Inaccurate, incomplete or unverifiable information must be removed or corrected, usually within 30 days. However, a consumer reporting agency may continue to report information it has verified as accurate.</li>\n<li>Consumer reporting agencies may not report outdated negative information. In most cases, a consumer reporting agency may not report negative information that is more than seven years old, or bankruptcies that are more than 10 years old.</li>\n<li>Access to your file is limited. A consumer reporting agency may provide information about you only to people with a valid need &ndash; usually to consider an application with a creditor, insurer, employer, landlord, or other business. The FCRA specifies those with a valid need for access.</li>\n<li>You must give your consent for reports to be provided to employers. A consumer reporting agency may not give out information about you to your employer, or a potential employer, without your written consent given to the employer. Written consent generally is not required in the trucking industry. For more information, go to www.consumerfinance.gov/learnmore</li>\n<li>You may limit &ldquo;prescreened&rdquo; offers of credit and insurance you get based on information in your credit report. Unsolicited &ldquo;prescreened&rdquo; offers for credit and insurance must include a toll-free phone number you can call if you choose to remove your name and address from the lists these offers are based on. You may opt-out with the nationwide credit bureaus at 1-888-567-8688.</li>\n<li>You may seek damages from violators. If a consumer reporting agency, or, in some cases, a user of consumer reports or a furnisher of information to a consumer reporting agency violates the FCRA, you may be able to sue in state or federal court.</li>\n<li>Identity theft victims and active duty military personnel have additional rights. For more information, visit www.consumerfinance.gov/learnmore.</li>\n</ul>\n\n<p>States may enforce the FCRA, and many states have their own consumer reporting laws. In some cases, you may have more rights under state law. For more information, contact your state or local consumer protection agency or your state Attorney General. For information about your federal rights, contact:</p>\n\n<p>&nbsp;</p>\n\n<table>\n<thead>\n<tr>\n<th>\n<p>Type of business</p>\n</th>\n<th>\n<p>Contact</p>\n</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>1.a. Banks, savings associations, and credit unions with total assets of over $10 billion and their affiliates.</td>\n<td>a. Consumer Financial Protection Bureau 1700 G Street NW, Washington, DC 20552</td>\n</tr>\n<tr>\n<td>1.b. Such affiliates that are not banks, savings associations, or credit unions also should list, in addition to the CFPB:<